import Svg, { Path } from "react-native-svg"
const Quote = (props) => (
  <Svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 96.11 64.07" {...props}>
    <Path
      d="M96.11 32.04c0 11.24-1.93 22.02-5.47 32.03C77.45 26.75 41.85 0 0 0h90.64c3.55 10.02 5.47 20.8 5.47 32.04Z"
      style={{
        fill: "#51e07d",
        strokeWidth: 0,
      }}
    />
  </Svg>
)
export default Quote
